import logo from './logo.svg';
import './App.css';

import React, { Component } from 'react';
import Navbar from './Navbar';
import News from './News';
import { BrowserRouter, Routes, Route } from 'react-router';

export default class App extends Component {
  render() {
    return (
      <div>
        <BrowserRouter>
          <Navbar />
          <Routes>
            <Route expath="/" element={<News pagesize={5} country="us" category="general" />} />
            <Route expath="/entertainment" element={<News pagesize={5} country="us" category="entertainment" />} />
            <Route expath="/general" element={<News pagesize={5} country="us" category="general" />} />
            <Route expath="/health" element={<News pagesize={5} country="us" category="health" />} />
            <Route expath="/science" element={<News pagesize={5} country="us" category="science" />} />
            <Route expath="/sports" element={<News pagesize={5} country="us" category="sports" />} />
            <Route expath="/technology" element={<News pagesize={5} country="us" category="technology" />} />
          </Routes>
        </BrowserRouter>
      </div>
    );
  }
}
